import React, { useEffect, useState } from "react";
import { useForm } from 'react-hook-form';
import axios from "axios";
import { Button, FloatingLabel, Modal, Form } from "react-bootstrap";

interface FormData {
    sname: string
    smob: string
    semail: string
    sstandard: number
    sparent1: string
    sparent2: string
  }

  const Studentlist = () =>{
    const [notesList, setnotesList] = useState<Array<FormData>>([]);
    const { register, handleSubmit, reset } = useForm<FormData>();

    useEffect(() => {
        getStudent();
      }, []);
    const getStudent= async () => {
        try{
            const response = await axios.get('http://localhost:5000/students')
            const gotdata =  response.data;
            console.log(gotdata);
            setnotesList(gotdata);
          }catch(err){
            console.error(err);
          }
        };
    return (
      <div>
        <div className="container-fluid"><br></br><br></br>
          <div className="row">
            <div className="col-md-12">
            <h3>STUDENTS</h3><br></br><br></br>
              <form>
                <table>
                    <tr>
                    {notesList.map((noteitem, index) => {
                    return (
                        <td>{noteitem.sname}</td>
                    );
                    })}

                    </tr>

                </table>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
    }

    export default Studentlist;
